Philip J. Carter, Kenneth A. Russel, &quot;Baffling Brain Teasers (Test Your Intelligence)&quot;
English | 1992 | ISBN: 0706370902 | 128 pages | Djvu | 1 MB

A follow-up title to Alan Wareham's &quot;Brain Teasers&quot;, with over 100 brain-teasing questions graded from easy to very difficult. The authors have also written &quot;Take the IQ Test&quot; and &quot;Take the IQ Challenge&quot; series.
